import React from "react";

function Topseaction() {

  return (
    <div className="roundee">
      {data.map((el) => (
        <div className="round">
          {" "}
          <p className={el.class}>1</p>{" "}
          <p className="small">
            <span>{el.name}</span>
            <span>{el.amount}</span>
            <span>{el.increment}</span>
          </p>
        </div>
      ))}
    </div>
  );
}

export default Topseaction;
